import React from 'react'

// props: name
function Theme() {
    /*
    return (
        <div>
            <h2>{props.content.name}</h2>
            <Image content={{
                source:"#",
                caption:"#"
            }}/>

            <h2>{props.content.name}</h2>
            <Image content={{
                source:"#",
                caption:"#"
            }} 
            />
        </div>
    )
    */
}

export default Theme
